    return(<div className="parent-side" ><NavLink to="Users"className="side-bar"><i className="fa-solid fa-users"></i>Users</NavLink>
    <NavLink  to="Create"className="side-bar"><i className="fa-solid fa-user-plus"></i> New Users</NavLink>
    
    </div>)
}
